HQ rare promo music video from a promo DVD. &quot;Nobody's Real&quot; is an industrial metal song by Powerman 5000 featured on the album Tonight the Stars Revolt! and on the End of Days soundtrack. A music video was made in which a young boy discovers a robotic mask that grants him supernatural powers. On the band's &quot;Rockets &amp; Robots&quot; tour in early 2000, they performed the song in a modified version, for their encores. 

In 1991, Spider (Spider One is the younger brother of fellow metal musician Rob Zombie) dropped out of art school, bought a cheap 4-track home studio and drum machine and recorded Much Evil with producer Lamar Lowder. Building on local success, Powerman 5000 was born. In 1993, longtime guitarist Adam 12 joined the band. In 1994 and 1995, Powerman released two independent records, True Force and The Blood-Splat Rating System. Both albums were local successes. In 1996, they performed on the second stage of Ozzfest and appeared in an episode of Beverly Hills, 90210 where David and Donna filmed a music video for their song &quot;Strike the Match&quot;.

In 1997, the band signed to Dreamworks Records and released a remastered edition of The Blood-Splat Rating System titled Mega!! Kung Fu Radio. The band toured, performing on the main stage at Ozzfest 1997 but have not appeared since. They released singles such as &quot;Organizized&quot; and &quot;Tokyo Vigilante #1&quot;. In 1999, guitarist M.33 (Mike Tempesta) joined the band as they got their biggest break. Creating a strange fusion of science fiction and &quot;Action Rock&quot;, they released Tonight the Stars Revolt!, which contained the hit singles &quot;When Worlds Collide&quot;, &quot;Nobody's Real&quot;, and &quot;Supernova Goes Pop&quot;. The album sold over a million copies.


Powerman 5000 (sometimes abbreviated to PM5K) is an American rock band formed in 1991. The group has released seven albums over the course of their career and gained their highest commercial success with 1999's Tonight the Stars Revolt!, which reached No. 29 on the Billboard 200 album chart while spawning the top 40 hits &quot;When Worlds Collide&quot; and &quot;Nobody's Real&quot;. Their latest release, covers album Copies Clones &amp; Replicants, came out in 2011 through indie label Cleopatra Records, and the group is currently working on their next album. Frontman and only original member Spider One is the younger brother of fellow metal musician Rob Zombie.

Their newest album, Builders of the Future, was released on May 27, 2014. The band is set to play a co-headlining tour in the US with Wayne Static in November with American Head Charge supporting them.
